 this page." /><img id="mw-fr-revisiontoggle" class="fr-toggle-arrow" src="/w/extensions/FlaggedRevs/frontend/modules/img/arrow-down.png" style="display:none;" alt="show/hide details" /></div> <div id="mw-fr-revisiondetails-wrapper" style="position:relative;"><div id="mw-fr-revisiondetails" class="flaggedrevs_short_details" style="display:none">This is the <a href="/wiki/Wikipedia:Pending_changes" title="Wikipedia:Pending changes">latest accepted revision</a>, <a class="external text" href="//en.wikipedia.org/w/index.php?title=Special:Log&amp;type=review&amp;page=Alien">reviewed</a> on <i>17 December 2017</i>.</div> </div> </div> </div> 								<div id="jump-to-nav" class="mw-jump"> 					Jump to:					<a href="#mw-head">navigation</a>, 					<a href="#p-search">search</a> 				</div> 				<div id="mw-content-text" lang="en" dir="ltr" class="mw-content-ltr"><div class="mw-parser-output"><table role="presentation" class="mbox-small plainlinks sistersitebox" style="background-color:#f9f9f9;border:1px solid #aaa;color:#000"> <tr> <td class="mbox-image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/40px-Wiktionary-logo-en-v2.svg.png" width="40" height="40" class="noviewer" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/60px-Wiktionary-logo-en-v2.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/80px-Wiktionary-logo-en-v2.svg.png 2x" data-file-width="391" data-file-height="391" /></td> <td class="mbox-text plainlist">Look up <i><b><a href="https://en.wiktionary.org/wiki/alien" class="extiw" title="wiktionary:alien">alien</a></b></i>&#160;or <i><b><a href="https://en.wiktionary.org/wiki/aliens" class="extiw" title="wiktionary:aliens">aliens</a></b></i> in Wiktionary, the free dictionary.</td> </tr> </table> <p><b>Alien</b> primarily refers to:</p> <ul> <li><a href="/wiki/Extraterrestrial_life" title="Extraterrestrial life">Extraterrestrial life</a>, life which does not originate from Earth <ul> <li>Specifically, intelligent extraterrestrial beings. See <a href="/wiki/List_of_alleged_extraterrestrial_beings" title="List of alleged extraterrestrial beings">List of alleged extraterrestrial beings</a>.</li> </ul> </li> <li><a href="/wiki/Alien_(law)" title="Alien (law)">Alien (law)</a>, a person in a country who is not a national of that country</li> </ul> <p><b>Alien(s)</b>, or <b>The Alien(s)</b> may also refer to:</p> <div style="clear: right; margin-bottom: .5em; float: right; padding: .5em 0 .8em 1.4em; background: none; width: auto;"> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#Science_and_technology"><span class="tocnumber">1</span> <span class="toctext">Science and technology</span></a></li> <li class="toclevel-1 tocsection-2"><a href="#Arts_and_entertainment"><span class="tocnumber">2</span> <span class="toctext">Arts and entertainment</span></a> <ul> <li class="toclevel-2 tocsection-3"><a href="#Films"><span class="tocnumber">2.1</span> <span class="toctext">Films</span></a></li> <li class="toclevel-2 tocsection-4"><a href="#Literature"><span class="tocnumber">2.2</span> <span class="toctext">Literature</span></a></li> <li class="toclevel-2 tocsection-5"><a href="#Music"><span class="tocnumber">2.3</span> <span class="toctext">Music</span></a> <ul> <li class="toclevel-3 tocsection-6"><a href="#Performers"><span class="tocnumber">2.3.1</span> <span class="toctext">Performers</span></a></li> <li class="toclevel-3 tocsection-7"><a href="#Albums"><span class="tocnumber">2.3.2</span> <span class="toctext">Albums</span></a></li> <li class="toclevel-3 tocsection-8"><a href="#Songs"><span class="tocnumber">2.3.3</span> <span class="toctext">Songs</span></a></li> </ul> </li> <li class="toclevel-2 tocsection-9"><a href="#Video_games"><span class="tocnumber">2.4</span> <span class="toctext">Video games</span></a></li> <li class="toclevel-2 tocsection-10"><a href="#Other_media"><span class="tocnumber">2.5</span> <span class="toctext">Other media</span></a></li> </ul> </li> <li class="toclevel-1 tocsection-11"><a href="#Other_uses"><span class="tocnumber">3</span> <span class="toctext">Other uses</span></a></li> <li class="toclevel-1 tocsection-12"><a href="#See_also"><span class="tocnumber">4</span> <span class="toctext">See also</span></a></li> </ul> </div> </div> <h2><span class="mw-headline" id="Science_and_technology">Science and technology</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Alien&amp;action=edit&amp;section=1" title="Edit section: Science and technology">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Introduced_species" title="Introduced species">Introduced species</a>, a species not native to its environment</li> <li><a href="/wiki/Alien_(software)" title="Alien (software)">Alien (software)</a>, a Linux program</li> <li><a href="/wiki/AliEn_(ALICE_Environment)" class="mw-redirect" title="AliEn (ALICE Environment)">AliEn (ALICE Environment)</a>, a grid framework</li> <li><a href="/wiki/Alien_Technology" title="Alien Technology">Alien Technology</a>, a manufacturer of RFID technology</li> <li><i>Aliens</i>, a newsletter of the IUCN <a href="/wiki/Invasive_Species_Specialist_Group" class="mw-redirect" title="Invasive Species Specialist Group">Invasive Species Specialist Group</a></li> </ul> <h2><span class="mw-headline" id="Arts_and_entertainment">Arts and entertainment</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Alien&amp;action=edit&amp;section=2" title="Edit section: Arts and entertainment">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Alien_(franchise)" title="Alien (franchise)"><i>Alien</i> (franchise)</a>, a media franchise <ul> <li><a href="/wiki/Alien_(creature_in_Alien_franchise)" title="Alien (creature in Alien franchise)">Alien (creature in <i>Alien</i> franchise)</a></li> </ul> </li> </ul> <h3><span class="mw-headline" id="Films">Films</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Alien&amp;action=edit&amp;section=3" title="Edit section: Films">edit</a><span class="mw-editsection-bracket">]</span></span></h3> <ul> <li><a href="/wiki/Alien_(film)" title="Alien (film)"><i>Alien</i> (film)</a>, a 1979 film by Ridley Scott</li> <li><a href="/wiki/Aliens_(film)" title="Aliens (film)"><i>Aliens</i> (film)</a>, the 1986 sequel by James Cameron</li> <li><i><a href="/wiki/Alien_3" title="Alien 3">Alien 3</a></i>, third film in the series from 1992 by David Fincher</li> <li><a href="/wiki/The_Alien_(unreleased_film)" class="mw-redirect" title="The Alien (unreleased film)"><i>The Alien</i> (unreleased film)</a>, an incomplete 1960s Indian-American film</li> <li><a href="/wiki/The_Alien_(2016_film)" title="The Alien (2016 film)"><i>The Alien</i> (2016 film)</a>, a 2016 Mexican film</li> </ul> <h3><span class="mw-headline" id="Literature">Literature</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Alien&amp;action=edit&amp;section=4" title="Edit section: Literature">edit</a><span class="mw-editsection-bracket">]</span></span></h3> <ul> <li><a href="/wiki/Aliens_(Tappan_Wright_novel)" title="Aliens (Tappan Wright novel)"><i>Aliens</i> (Tappan Wright novel)</a>, a 1902 novel by Mary Tappan Wright</li> <li><a href="/wiki/The_Alien_(Animorphs)" class="mw-redirect" title="The Alien (Animorphs)"><i>The Alien</i> (Animorphs)</a>, the eighth book in the <i>Animorphs</i> series</li> <li><a href="/wiki/Alien_novels" title="Alien novels">Alien novels</a>, an extension of the <i>Alien</i> franchise</li> </ul> <h3><span class="mw-headline" id="Music">Music</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Alien&amp;action=edit&amp;section=5" title="Edit section: Music">edit</a><span class="mw-editsection-bracket">]</span></span></h3> <h4><span class="mw-headline" id="Performers">Performers</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Alien&amp;action=edit&amp;section=6" title="Edit section: Performers">edit</a><span class="mw-editsection-bracket">]</span></span></h4> <ul> <li><a href="/wiki/Alien_(band)" title="Alien (band)">Alien (band)</a>, a 1980s Swedish rock group</li> <li><a href="/wiki/The_Aliens_(Australian_band)" title="The Aliens (Australian band)">The Aliens (Australian band)</a>, a 1970s new wave group</li> <li><a href="/wiki/The_Aliens_(Scottish_band)" title="The Aliens (Scottish band)">The Aliens (Scottish band)</a>, a 2005–present rock group</li> </ul> <h4><span class="mw-headline" id="Albums">Albums</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Alien&amp;action=edit&amp;section=7" title="Edit section: Albums">edit</a><span class="mw-editsection-bracket">]</span></span></h4> <ul> <li><a href="/wiki/Alien_(Strapping_Young_Lad_album)" title="Alien (Strapping Young Lad album)"><i>Alien</i> (Strapping Young Lad album)</a></li> <li><a href="/wiki/Alien_(Tankard_album)" class="mw-redirect" title="Alien (Tankard album)"><i>Alien</i> (Tankard album)</a></li> <li><a href="/wiki/Alien_(soundtrack)" title="Alien (soundtrack)"><i>Alien</i> (soundtrack)</a></li> <li><a href="/wiki/Aliens_(soundtrack)" title="Aliens (soundtrack)"><i>Aliens</i> (soundtrack)</a></li> </ul> <h4><span class="mw-headline" id="Songs">Songs</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Alien&amp;action=edit&amp;section=8" title="Edit section: Songs">edit</a><span class="mw-editsection-bracket">]</span></span></h4> <ul> <li><a href="/wiki/Alien_(Britney_Spears_song)" title="Alien (Britney Spears song)">"Alien" (Britney Spears song)</a></li> <li><a href="/wiki/Alien_(Pennywise_song)" title="Alien (Pennywise song)">"Alien" (Pennywise song)</a></li> <li><a href="/wiki/Alien_(Third_Day_song)" class="mw-redirect" title="Alien (Third Day song)">"Alien" (Third Day song)</a></li> <li><a href="/wiki/Aliens_(Coldplay_song)" title="Aliens (Coldplay song)">"Aliens" (Coldplay song)</a></li> <li>"My Alien", a song by Simple Plan on the album <i><a href="/wiki/No_Pads,_No_Helmets..._Just_Balls" class="mw-redirect" title="No Pads, No Helmets... Just Balls">No Pads, No Helmets... Just Balls</a></i></li> <li>"Alien", a song by Bush on the album <i><a href="/wiki/Sixteen_Stone" title="Sixteen Stone">Sixteen Stone</a></i></li> <li>"Alien", a song by Erasure on the album <i><a href="/wiki/Loveboat_(album)" title="Loveboat (album)">Loveboat</a></i></li> <li>"Alien", a song by Japan on the album <i><a href="/wiki/Quiet_Life" title="Quiet Life">Quiet Life</a></i></li> <li>"Alien", a song by Lamb on the album <i><a href="/wiki/Fear_of_Fours" title="Fear of Fours">Fear of Fours</a></i></li> <li>"Alien", a song by Nerina Pallot on the album <i><a href="/wiki/Dear_Frustrated_Superstar" title="Dear Frustrated Superstar">Dear Frustrated Superstar</a></i></li> <li>"Alien", a song by P-Model on the album <i><a href="/wiki/Landsale_(P-Model_album)" class="mw-redirect" title="Landsale (P-Model album)">Landsale</a></i></li> <li>"Alien", a song by Thriving Ivory on <a href="/wiki/Thriving_Ivory_(album)" title="Thriving Ivory (album)">their self-titled album</a></li> <li>"Alien", a song by Tokio Hotel on the album <i><a href="/wiki/Humanoid_(album)" title="Humanoid (album)">Humanoid</a></i>. Also, fans of the band call themselves Aliens</li> <li>"The Aliens", a song by <a href="/wiki/Warlord_(band)" title="Warlord (band)">Warlord</a></li> </ul> <h3><span class="mw-headline" id="Video_games">Video games</span><span class="mw-editsection"><span class="mw-editsection-bracke